webpackJsonp([92738824975244],{5660:function(t,e){t.exports={data:{post:{html:'<p>Our ISDN router, an old 100 MHz machine running <a href="http://www.fli4l.de/">Linux on a floppy</a>, wouldn\'t restart last night. I spent 2 hours to figure out that it was the <i>video</i> card that went south. Strange, because it never has a monitor attached. The video card is only there because the BIOS insists on having it.</p>',fields:{title:"Strange Things That Break",date:"21 Jul 2002",url:"https://papascott.de/2002-07-21-strange-things-that-break/"}}},pathContext:{slug:"/2002-07-21-strange-things-that-break/",prev:{fields:{title:"It's Raining Men",date:"21 Jul 2002",slug:"/2002-07-21-its-raining-men/"}},next:{fields:{title:"We Live Like A Future Minister",date:"22 Jul 2002",slug:"/2002-07-22-we-live-like-a-future-minister/"}}}}}});
